        "\n                   \n\n\n\n\n\n\n\n\n\n\n\n\n\n  Interfaces\n  Result\n\n\n\n        \n            Info\n        \n        \n            Source\n        \n\n\n\n    \n        \n            File\n        \n        \n            src/app/graphql/branches.query.ts\n        \n\n\n\n        \n            Index\n            \n                \n                    \n                        \n                            Properties\n                        \n                    \n                    \n                        \n                            \n                                \n                                        repository\n                                \n                            \n                        \n                    \n                \n            \n        \n\n\n\n            \n                Properties\n                    \n                        \n                                \n                                    \n                                        \n                                        repository\n                                    \n                                \n                                \n                                    \n                                        repository:     literal type\n\n                                    \n                                \n\n\n                                    \n                                        \n                                            Type :     literal type\n\n                                        \n                                    \n\n\n\n\n\n                        \n                    \n            \n    \n\n\n    \n        import gql from 'graphql-tag';\nimport { MappingQuery } from './mapping-query';\nimport { ApolloQueryResult } from 'apollo-client';\nimport { Injectable } from '@angular/core';\n\nexport interface Variables {\n  name: string;\n  owner: string;\n}\n\ninterface Edge {\n  node: {\n    name: string;\n  };\n}\n\nexport interface Result {\n  repository: {\n    refs: {\n      totalCount: number;\n      edges: Edge[];\n    };\n  };\n}\n\n@Injectable({\n  providedIn: 'root'\n})\nexport class BranchQuery extends MappingQuery {\n  document = gql`\n    query($owner: String!, $name: String!) {\n      repository(owner: $owner, name: $name) {\n        refs(first: 100, refPrefix: \"refs/heads/\") {\n          totalCount\n          edges {\n            node {\n              name\n            }\n          }\n        }\n      }\n    }\n  `;\n\n  protected mapper(result: ApolloQueryResult): string[] {\n    return result.data.repository.refs.edges.map(edge => edge.node.name);\n  }\n}\n\n    \n\n\n\n                   \n\n\n\n\n                   \n    \n         result-matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"
