        "\n                   \n\n\n\n\n\n\n\n\n\n\n\n\n\n  Interfaces\n  Result\n\n\n\n        \n            Info\n        \n        \n            Source\n        \n\n\n\n    \n        \n            File\n        \n        \n            src/app/graphql/tree.query.ts\n        \n\n\n\n        \n            Index\n            \n                \n                    \n                        \n                            Properties\n                        \n                    \n                    \n                        \n                            \n                                \n                                        repository\n                                \n                            \n                        \n                    \n                \n            \n        \n\n\n\n            \n                Properties\n                    \n                        \n                                \n                                    \n                                        \n                                        repository\n                                    \n                                \n                                \n                                    \n                                        repository:     literal type\n\n                                    \n                                \n\n\n                                    \n                                        \n                                            Type :     literal type\n\n                                        \n                                    \n\n\n\n\n\n                        \n                    \n            \n    \n\n\n    \n        import gql from 'graphql-tag';\nimport { MappingQuery } from './mapping-query';\nimport { ApolloQueryResult } from 'apollo-client';\nimport { Injectable } from '@angular/core';\n\nexport function treeSort(a: Entry, b: Entry) {\n  if (a.type !== b.type) {\n    return a.type === 'tree' ? -1 : 1;\n  }\n\n  return a.name.toLowerCase().localeCompare(b.name.toLowerCase());\n}\n\nexport interface Variables {\n  name: string;\n  owner: string;\n  expression: string;\n}\n\nexport interface Result {\n  repository: {\n    object: {\n      entries: Entry[];\n    };\n  };\n}\n\nexport interface Entry {\n  name: string;\n  type: 'tree' | 'blob';\n  object: {\n    oid: string;\n  };\n}\n\n@Injectable({\n  providedIn: 'root'\n})\nexport class TreeQuery extends MappingQuery {\n  document = gql`\n    query TreeQuery($name: String!, $owner: String!, $expression: String!) {\n      repository(name: $name, owner: $owner) {\n        object(expression: $expression) {\n          ... on Tree {\n            entries {\n              name\n              type\n              object {\n                oid\n              }\n            }\n          }\n        }\n      }\n    }\n  `;\n\n  protected mapper(result: ApolloQueryResult): Entry[] {\n    return result.data.repository.object.entries\n      .map(e => {\n        if (e.type === 'blob') {\n          return e;\n        } else {\n          return { ...e, children: [] };\n        }\n      })\n      .sort(treeSort);\n  }\n}\n\n    \n\n\n\n                   \n\n\n\n\n                   \n    \n         result-matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"
