    'index.html': {
      url: 'index.html',
      title: 'getting-started - index',
      body:
        '\n                   \n\nErmine \nErmine is a simple web app that allows you to browse any GitHub repository in an IDE look.\nYou can easily open multiple files with syntax highlighting for a huge amount of languages, or view images and CSV tables!\nOver 190 languages are supported for highlighting, with the help of Prism.js.\n\nCheck out the source code.\n\nHow it\'s build\nErmine is built with Angular 7, Angular Material and GitHub API v4.\nThe development process makes use of various Continuous Integration providers.\n\n\n\nProvider\nStatus\nTasks\n\n\n\n\nTravis CI\n\nRuns linter, tests and deploy\n\n\nCode Climate\n \nEnsures highest code quality\n\n\nsnyk\n\nChecks dependencies for vulnerabilities\n\n\n\nDocumentation\nThe documentation is created with Compodoc and is available here.\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n                   \n\n\n\n\n                   \n    \n         result-matching ""\n        \n    \n    \n        No results matching ""\n    \n\n'
    },
